import React from 'react';
import "./FaceRecog.css";
function FaceRecog() {
    return (
      <div className="FaceRecog">
          <img className="FaceRecog__image" width="150" src="https://avatars3.githubusercontent.com/u/35215212?s=460&u=6b00bdb73c492a0893335a537da6532e689e8991&v=4"/>
          <div className="FaceRecog__details">
            <div className="FaceRecog__name">Aayush</div>
            <div className="FaceRecog__address">Indore MP</div>
          </div>
      </div>
    )
}

export default FaceRecog
